import { createRoute } from '@tanstack/react-router'
import { UpdateIcon } from '@radix-ui/react-icons'
import { Check, Clipboard, FileWarning, X } from 'lucide-react'
import { Trans, useTranslation } from 'react-i18next'

import { Route as RootRoute } from '../../__root'

import { HomeBreadcrumb } from '../../../components/navigations/breadcrumb/home'
import {
  Breadcrumb,
  BreadcrumbItem,
  BreadcrumbList,
  BreadcrumbPage,
  BreadcrumbSeparator,
} from '../../../components/ui/breadcrumb'
import { Button } from '../../../components/ui/button'
import { Input } from '../../../components/ui/input'
import { GoToTop } from '../../../components/go-to-top'

import {
  defaultEULAAccountStatus,
  EULAAccountStatus,
} from '../../../state/accounts/eula'

import { useCustomizableMenuSettingsVisibility } from '../../../hooks/settings'
import { useEULAActions } from './-hooks'

import { whatIsThis } from '../../../lib/callbacks'
import { cn, parseCustomDisplayName } from '../../../lib/utils'

export const Route = createRoute({
  getParentRoute: () => RootRoute,
  path: '/account-management/eula',
  component: () => {
    const { t } = useTranslation(['sidebar'], {
      keyPrefix: 'account-management',
    })

    return (
      <>
        <Breadcrumb>
          <BreadcrumbList>
            <HomeBreadcrumb />
            <BreadcrumbSeparator />
            <BreadcrumbItem>
              <BreadcrumbPage>{t('title')}</BreadcrumbPage>
            </BreadcrumbItem>
            <BreadcrumbSeparator />
            <BreadcrumbItem>
              <BreadcrumbPage>EULA</BreadcrumbPage>
            </BreadcrumbItem>
          </BreadcrumbList>
        </Breadcrumb>
        <Content />
      </>
    )
  },
})

function Content() {
  const { t } = useTranslation(['account-management', 'general'])

  const {
    accounts,
    accountsArray,
    data,
    searchValue,
    handleCopyUrl,
    handleVerifyById,
    onChangeSearchValue,
  } = useEULAActions()
  // const { scrollToTopButtonIsVisible, scrollButtonOnClick } =
  //   useScrollToTop()
  const { getMenuOptionVisibility } =
    useCustomizableMenuSettingsVisibility()

  return (
    <>
      <div className="flex flex-grow">
        <div className="flex flex-col max-w-lg mx-auto w-full">
          <section
            className="border-l-8 mb-5 px-2 pt-1 text-sm"
            id="gtk-eula"
          >
            <h2 className="font-bold text-muted-foreground">
              {t('eula.good-to-know', {
                ns: 'account-management',
              })}
            </h2>
            <p className="text-muted-foreground">
              <Trans
                ns="account-management"
                i18nKey="eula.link"
                values={{
                  link: 'https://www.epicgames.com/account/eula-history',
                }}
              >
                You can go to{' '}
                <a
                  href="https://www.epicgames.com/account/eula-history"
                  className="font-bold text-primary"
                  onClick={(event) => {
                    event.preventDefault()
                    window.electronAPI.openExternalURL(
                      'https://www.epicgames.com/account/eula-history'
                    )
                  }}
                  onAuxClick={whatIsThis()}
                >
                  https://www.epicgames.com/account/eula-history
                </a>{' '}
                and click the "I Agree" button at the bottom of the page:
              </Trans>
            </p>
            <img
              src={eulaHistoryImg}
              className="mt-2"
            />
          </section>

          {accountsArray.length > 1 && (
            <div className="flex gap-3 items-center mb-5">
              <Input
                // placeholder={
                //   getMenuOptionVisibility('showTotalAccounts')
                //     ? `Search on ${accounts.length} accounts...`
                //     : 'Search on your accounts'
                // }
                placeholder={t('form.accounts.placeholder', {
                  ns: 'general',
                  context: !getMenuOptionVisibility('showTotalAccounts')
                    ? 'private'
                    : undefined,
                  total: accounts.length,
                })}
                value={searchValue}
                onChange={onChangeSearchValue}
              />
            </div>
          )}

          {accounts.length > 0 ? (
            <section className="flex flex-col gap-2 mb-10 w-full">
              {accounts.map((account) => {
                const current: EULAAccountStatus =
                  data[account.accountId] ?? defaultEULAAccountStatus
                const continuationUrl = current.url

                return (
                  <article
                    className="border rounded w-full"
                    key={account.accountId}
                  >
                    <div className="bg-muted-foreground/5 flex items-center min-h-10 px-1 py-0.5 text-center text-muted-foreground text-xs">
                      <span className="px-1 truncate max-w-28">
                        {parseCustomDisplayName(account)}
                      </span>
                      <div className="flex gap-3 items-center ml-auto">
                        <div
                          className={cn('flex gap-1 items-center', {
                            'opacity-0 pointer-events-none select-none':
                              typeof current.status !== 'boolean',
                            'text-green-600': current.status === true,
                            'font-bold text-[#ff6868]':
                              current.status === false,
                          })}
                        >
                          {current.status ? (
                            <>
                              <Check size={16} />
                              {t('actions.accepted', {
                                ns: 'general',
                              })}
                            </>
                          ) : (
                            <>
                              <X size={16} />
                              {current.correctiveAction}
                            </>
                          )}
                        </div>
                        <Button
                          className="h-8 relative w-24"
                          variant="secondary"
                          onClick={handleVerifyById(account.accountId)}
                          disabled={current.isLoading}
                        >
                          {current.isLoading ? (
                            <UpdateIcon className="animate-spin" />
                          ) : (
                            t('actions.verify', {
                              ns: 'general',
                            })
                          )}
                        </Button>
                      </div>
                    </div>
                    <footer className="px-2- py-1- rounded-b">
                      <div
                        className={cn(
                          'flex items-center overflow-hidden relative rounded-md'
                        )}
                      >
                        <Input
                          className={cn(
                            'border-none pr-10 select-none text-blue-400 focus-visible:ring-0 focus-visible:ring-offset-0 focus-visible:ring-transparent'
                          )}
                          placeholder="Generated link to EULA"
                          value={continuationUrl ?? ''}
                          readOnly
                        />
                        <Button
                          variant="ghost"
                          className={cn(
                            'absolute p-0 right-1 size-8 z-20'
                          )}
                          onClick={handleCopyUrl(current.url)}
                          disabled={continuationUrl === null}
                        >
                          <Clipboard size={16} />
                        </Button>
                      </div>
                    </footer>
                  </article>
                )
              })}
            </section>
          ) : (
            <div className="my-20 text-center text-muted-foreground">
              <FileWarning
                size={48}
                className="mx-auto"
              />
              <div className="mt-2">
                {t('form.accounts.search-empty', {
                  ns: 'general',
                })}
              </div>
            </div>
          )}
        </div>
      </div>

      {/* <Button
        className={cn(
          'bottom-5 fixed opacity-0 px-4 right-5 transition-all translate-x-28 z-50',
          {
            'opacity-100 translate-x-0': scrollToTopButtonIsVisible,
          }
        )}
        size="sm"
        variant="secondary"
        onClick={scrollButtonOnClick}
      >
        Go To Top
      </Button> */}
      <GoToTop containerId="gtk-eula" />
    </>
  )
}

const eulaHistoryImg =
  'data:image/jpeg;base64,'
